import React, { Fragment } from 'react';
import Header from './components/Header';

function App() {
  return (
    <Fragment>
      <Header/>
      <main>
        <MDBContainer>
          <MDBRow className='mb-3'>
            <MDBCol size='4' className='col-example'>
              col="5"
            </MDBCol>
            <MDBCol size='4' className='col-example'>
              col="7"
            </MDBCol>
          </MDBRow>
        </MDBContainer>
      </main>
    </Fragment>
  );
}

export default App;
